                path="/"
                element={<Loginwithgoogle setLoggedin={setLoggedin} />}
              />

              {isLoggedin && (
                <>
                  <Route path="/home" element={<App />} />
                  <Route path="/list" element={<FilesList />} />
                </>
              )}
            </Routes> */}
          </div>
        </div>
      </BrowserRouter>
    </GoogleOAuthProvider>
  );
};

export default AppRouter;
